process_lines.html.body:
ライン処理
概要
簡単なサンプルプログラムを見てみましょう。このプログラムはCのメインループを使って標準入力から行を読み込み、ECMAScriptヘルパーを呼び出して行を変換し、その結果をプリントアウトします。行処理機能は、正規表現のようなECMAScriptの良いところを利用することができ、Cプログラムを再コンパイルすることなく簡単に変更することができる。
スクリプトのコードはprocess.jsに配置される。行処理関数の例では、プレーンテキストの行をHTMLに変換し、星の間のテキストを自動的に太字にする。

https://github.com/svaarala/duktape/blob/master/examples/guide/process.js

C言語のコードprocesslines.cは、Duktapeコンテキストを初期化し、スクリプトを評価した後、標準入力から行を処理し、各行に対してprocessLine()を呼び出します。

https://github.com/svaarala/duktape/blob/master/examples/guide/processlines.c

processlines.cの内訳
このサンプルコードのDuktape固有の部分を一つ一つ見ていきましょう。ここでは簡潔にするため、いくつかの詳細について説明します。詳細については、プログラミング・モデルを参照してください。
/* For brevity assumes a maximum file length of 16kB. */
static void push_file_as_string(duk_context *ctx, const char *filename) {
    FILE *f;
    size_t len;
    char buf[16384];

    f = fopen(filename, "rb");
    if (f) {
        len = fread((void *) buf, 1, sizeof(buf), f);
        fclose(f);
        duk_push_lstring(ctx, (const char *) buf, (duk_size_t) len);
    } else {
        duk_push_undefined(ctx);
    }
}

Duktapeは埋め込み可能なエンジンであり、最小限の仮定を行うため、デフォルトのCまたはECMAScript APIにはファイルI/Oバインディングがありません。上記のヘルパーは、ファイルの内容を文字列としてプッシュする方法の例です。この例では簡潔にするために固定の読み込みバッファを使っていますが、より良い実装ではまずファイルのサイズをチェックして、そのバッファを確保することになるでしょう。Duktapeの配布物には「extras」が含まれており、ファイルI/Oヘルパーを含む、便利なCやECMAScriptヘルパーが提供されています。
ctx = duk_create_heap_default();
if (!ctx) {
    printf("Failed to create a Duktape heap.\n");
    exit(1);
}

まず、Duktapeコンテキストを作成します。コンテキストは、値をスタックにプッシュしたりポッピングしたりすることで、ECMAScriptコードと値を交換できるようにします。Duktape APIのほとんどの呼び出しは、値スタックを操作し、スタック上の値をプッシュ、ポッピング、検査します。実運用コードでは、致命的なエラー・ハンドラを設定できるように duk_create_heap() を使用する必要があります。エラー処理のベストプラクティスについては、 エラー処理 を参照してください。
push_file_as_string(ctx, "process.js");
if (duk_peval(ctx) != 0) {
    printf("Error: %s\n", duk_safe_to_string(ctx, -1));
    goto finished;
}

duk_pop(ctx);  /* ignore result */

まず、ファイルヘルパーを使って、process.js を文字列としてバリュースタックにプッシュします。それから duk_peval() を使ってスクリプトをコンパイルし、実行します。このスクリプトは、後で使用するために processLine() を ECMAScript グローバルオブジェクトに登録します。保護された呼び出しである duk_peval() はスクリプトの実行に使用され、構文エラーのようなスクリプトのエラーは致命的なエラーを引き起こすことなく捕捉され処理されるようにします。エラーが発生した場合、エラーメッセージは duk_safe_to_string() を使って安全に強制され、さらなるエラーを発生させないことが保証されます。文字列強制の結果は、読み取り専用で NUL 終端の UTF-8 エンコード文字列を指す const char * で、printf() で直接使用することができます。この文字列は、対応する文字列値が値スタック上にある限り、有効である。文字列は、値が値スタックからポップ・オフされると、自動的に解放される。
duk_push_global_object(ctx);
duk_get_prop_string(ctx, -1 /*index*/, "processLine");

最初の呼び出しは、ECMAScript のグローバルオブジェクトを値スタックにプッシュします。2 番目の呼び出しは、グローバルオブジェクトの processLine プロパティを検索します (process.js 内のスクリプトで定義されています)。負の値はスタック要素を上から順に参照するので、-1 はスタックの最上位要素であるグローバルオブジェクトを参照します。
duk_push_string(ctx, line);

line が指す文字列を値スタックにプッシュする。文字列の長さは、 strlen() のように NUL ターミネータをスキャンすることで自動的に決定されます。Duktape は、文字列がスタックにプッシュされたときにそのコピーを作成するので、呼び出しが返されたときにラインバッファを自由に変更することができる。
if (duk_pcall(ctx, 1 /*nargs*/) != 0) {
    printf("Error: %s\n", duk_safe_to_string(ctx, -1));
} else {
    printf("%s\n", duk_safe_to_string(ctx, -1));
}
duk_pop(ctx);  /* pop result/error */

このとき、値スタックに含まれる（スタックは右側に成長する）。
[ globalObject processLine line ]
duk_pcall() メソッドは、バリュースタック上に指定された数の引数で関数を呼び出し、関数と引数の値の両方を関数の戻り値に置き換えます。ここでは、nargs の数が 1 なので、processLine 関数と行が戻り値に置き換えられ、結果的にバリュースタックは次のようになります。
[ globalObject callResult ]
この呼び出しは、エラーを捕捉してプリントできるように保護されている。duk_safe_to_string() API 呼び出しは、エラーを安全に印刷するために再び使用されます。一度印刷されると、結果（またはエラー）は値スタックからポップオフされ、グローバルオブジェクトはまだスタックに残ります。
duk_destroy_heap(ctx);

最後に、Duktapeコンテキストは破棄され、コンテキストが保持するすべてのリソースが解放されます。この呼び出しによって、値スタックと値スタック上の全ての参照が解放されます。この例では、グローバル・オブジェクトを意図的に値スタックに残しています。これは問題ではありません。ヒープが破壊されたときに値スタックが空でなくても、メモリリークは発生しません。
コンパイル
単純に次のようにコンパイルします。
# src/ contains Duktape sources from the distributable or prepared
# explicitly using tools/configure.py.

$ gcc -std=c99 -o processlines -Isrc/ src/duktape.c processlines.c -lm

テスト実行、process.jsがカレントディレクトリにあることを確認する。
$ echo "I like *Sam & Max*." | ./processlines
I like Sam & Max.

prime_test.html.body:
プライマリーテスト
入門：行処理の例では、ECMAScriptでは簡単だがCでは難しいことを、CコードがECMAScriptに呼び出すことができることを説明しました。
この記事の例はその逆で、ECMAScript のコードが C のコードを呼び出す方法を説明します：スクリプトは多くのことに有用ですが、低レベルのバイトや文字処理には最適ではありません。最適化された C ヘルパーを呼び出すことができれば、スクリプト・ロジックの大部分を美しい ECMAScript で書き、パフォーマンスが重要な部分については C を呼び出すことができます。ネイティブ関数を使用するもう一つの理由は、ネイティブライブラリへのアクセスを提供することです。
ネイティブ関数を実装するには、Duktape/Cバインディングという特別な呼び出し方法に従った普通のC関数を書きます。Duktape/C関数は1つの引数（Duktapeコンテキスト）を取り、エラーまたは戻り値の数を示す1つの値を返します。関数は、Duktape APIで操作されたDuktapeコンテキストの値スタックを介して、呼び出しの引数にアクセスし、戻り値を提供します。Duktape/CバインディングとDuktape APIについては、後ほど詳しく説明します。
簡単な例：数値を二乗する
簡単な例を挙げます。
duk_ret_t my_native_func(duk_context *ctx) {
    double arg = duk_require_number(ctx, 0 /*index*/);
    duk_push_number(ctx, arg * arg);
    return 1;
}

これを一行ずつ見ていきましょう。
double arg = duk_require_number(ctx, 0 /*index*/);

値スタックインデックス0（スタックの底、関数呼び出しの第1引数）の数値が数値であるかどうかをチェックし、そうでない場合はエラーを投げて決して戻りません。値が数値の場合、doubleとして返す。
duk_push_number(ctx, arg * arg);

引数の2乗を計算し、値スタックにプッシュする。
return 1;

関数呼び出しから戻り、値スタックの最上位に（単一の）戻り値があることを示す。複数の戻り値はまだサポートされていません。0を返して戻り値がないことを示すこともできますが、その場合DuktapeのデフォルトはECMAScriptのundefinedになります。負の戻り値は、自動的にエラーをスローします。これは、エラーをスローするための便利な省略記法です。Duktape は、関数が戻った時に自動的にその処理を行います。詳しくは、プログラミング・モデルを参照してください。
プライマリーテスト
ECMAScriptのアルゴリズムを高速化するためにネイティブコードを使用する例として、プリマリティテストを使用することにします。具体的には、私たちのテストプログラムは1000000以下のプリムで、数字'9999'で終わるものを探します。このプログラムのECMAScriptバージョンは次の通りです。

https://github.com/svaarala/duktape/blob/master/examples/guide/prime.js

このプログラムはネイティブヘルパーがあればそれを使い、なければECMAScriptバージョンにフォールバックすることに注意してください。これにより、ECMAScriptのコードは他の含むプログラムで使用することができます。また、プライムチェックのプログラムが、変更しないとネイティブ版がコンパイルできない別のプラットフォームに移植された場合、ヘルパーが移植されるまで、プログラムは（速度は遅いですが）機能し続けます。この場合、ネイティブヘルパーの検出はスクリプトがロードされたときに行われます。また、実際にコードが呼び出されたときに検出することもでき、より柔軟な対応が可能です。
primeCheckECMAScript() と同等の機能を持つネイティブヘルパーは、 非常に簡単に実装することができます。プログラムmainを追加し、ECMAScriptグローバルオブジェクトに単純なprint()バインディングを追加すると、primecheck.cが得られます。

https://github.com/svaarala/duktape/blob/master/examples/guide/primecheck.c

Getting started: line processingと比較した新しいコールは、一行一行です。
int val = duk_require_int(ctx, 0);
int lim = duk_require_int(ctx, 1);

これらの 2 つのコールは、ネイティブヘルパーに与えられた 2 つの引数値をチェックします。もし値が ECMAScript の数値型でない場合はエラーがスローされます。数値であれば、その値は整数に変換され、val と lim ロケールに代入されます。インデックス 0 は最初の関数引数を、インデックス 1 は 2 番目の関数引数を指します。
技術的には、duk_require_int() は duk_int_t を返します。この間接型は、int が 16 ビット幅しかない稀なプラットフォームを除いて、常に int にマップされます。通常のアプリケーションコードでは、このことを気にする必要はありません。
duk_push_false(ctx);
return 1;

ECMAScript の false を値スタックにプッシュします。C の戻り値 1 は、ECMAScript の呼び出し元に false 値が返されることを示す。
duk_push_global_object(ctx);
duk_push_c_function(ctx, native_prime_check, 2 /*nargs*/);
duk_put_prop_string(ctx, -2, "primeCheckNative");

最初の呼び出しは、前と同様に、ECMAScript グローバルオブジェクトを値スタックにプッシュします。2 番目の呼び出しは ECMAScript Function オブジェクトを作成し、それを値スタックにプッシュします。この Function オブジェクトは Duktape/C の関数 native_prime_check() に束縛されています：ここで作成された ECMAScript 関数が ECMAScript から呼び出されると、C 関数が呼び出されます。第2呼び出し引数(2)は、C関数が値スタック上にいくつの引数を取得するかを示す。呼び出し側が与える引数が少なければ、不足する引数は undefined で埋められ、呼び出し側が与える引数が多ければ、余分な引数は自動的に削除される。最後に、3回目の呼び出しで、関数オブジェクトを primeCheckNative という名前でグローバルオブジェクトに登録し、関数値をスタックからポップアウトします。
duk_get_prop_string(ctx, -1, "primeTest");
if (duk_pcall(ctx, 0) != 0) {
    printf("Error: %s\n", duk_safe_to_string(ctx, -1));
}
duk_pop(ctx);  /* ignore result */

ここに来たとき、値スタックはすでにスタックの一番上にグローバルオブジェクトを含んでいます。1 行目は、グローバルオブジェクト（ロードされたスクリプトによって定義された）から primeTest 関数を検索しています。2-4 行目は、primeTest 関数を引数ゼロで呼び出し、エラーが発生した場合は安全にプリントアウトします。5 行目では、呼び出しの結果をスタックから取り出しています。
コンパイルと実行
前回と同様にコンパイルします。
# src/ contains Duktape sources from the distributable or prepared
# explicitly using tools/configure.py.

$ gcc -std=c99 -o primecheck -Isrc/ src/duktape.c primecheck.c -lm

テスト実行、prime.jsがカレントディレクトリにあることを確認します。
$ time ./primecheck
Have native helper: true
49999 59999 79999 139999 179999 199999 239999 289999 329999 379999 389999
409999 419999 529999 599999 619999 659999 679999 769999 799999 839999 989999

real    0m2.985s
user    0m2.976s
sys 0m0.000s

実行時間のほとんどはプライムチェックに費やされるため、プレーンなECMAScriptと比較して大幅なスピードアップを実現しています。prime.jsを編集して、ネイティブヘルパーの使用を無効にすることで確認できます。
// Select available helper at load time
var primeCheckHelper = primeCheckECMAScript;

再コンパイルして、テストを再実行する。
$ time ./primecheck
Have native helper: false
49999 59999 79999 139999 179999 199999 239999 289999 329999 379999 389999
409999 419999 529999 599999 619999 659999 679999 769999 799999 839999 989999

real    0m23.609s
user    0m23.573s
sys 0m0.000s

how_to_use_virtual_properties.html.body:
仮想プロパティの活用方法
Duktapeは、プロパティアクセスをプログラムで操作するための2つのメカニズムを提供します。

アクセサー・プロパティ(ゲッターとセッター)
プロキシ・オブジェクト

ECMAScript E5 のアクセサー・プロパティ（ゲッターとセッター）
アクセサの概要
ECMAScript Edition 5 は、プロパティの読み取り/書き込み操作をユーザ関数で捕捉できるようにするアクセサ・プロパティ（"ゲッターとセッター "とも呼ばれる）を提供します。セッター/ゲッター関数は、ECMAScript と Duktape/C の両方の関数にすることができます。
アクセサは、ECMAScript コードからは Object.defineProperty() または Object.defineProperties() を、C コードからは duk_def_prop() を使ってセットアップされます。
例
obj.colorへの書き込みをキャプチャして、色値を検証し、副作用として再描画をトリガすることができるようにします。
var obj = {};

function validateColor(color) {
    // 真または偽を返す
}

Object.defineProperty(obj, 'color', {
    enumerable: false,
    configurable: false,
    get: function () {
        // 現在の色は、ここで生の _color プロパティに格納されます。
        return this._color;
    },
    set: function (v) {
        if (!validateColor(v)) {
            // 有効なカラーフォーマットのみを割り当てる
            throw new TypeError('invalid color: ' + v);
        }
        this._color = v;
        redraw();
    }
});

// Change to red and trigger a redraw.
obj.color = '#ff0000';

制限事項
セッターとゲッターは、E5標準の一部であり、広く実装されているという利点があります。しかし、大きな制約もあります。

プロパティの読み込みと書き込みの操作に限定される。プロパティの削除やオブジェクトの列挙などには対応できない。

事前にアクセッサとして設定した個々のプロパティにのみ適用されます。特定のオブジェクトのすべてのプロパティアクセスを捕捉することはできないため、大きなアレイの仮想化など、いくつかのシナリオで有用性が制限されます。

標準的なプロパティ・ゲッター／セッター関数は、プロパティ・キーを引数として取得しないため（この動作はECMAScript仕様で定義されています）、複数のプロパティに対するゲッター／セッター関数を共有することができません。しかし、Duktapeは、プロパティ名を追加の非標準引数として持つゲッター/セッター関数を提供します; 以下の議論を参照してください。


非標準のゲッター/セッターキー引数
Duktapeは、プロパティ・アクセスによってゲッター/セッターが引き起こされる場合、非標準的なゲッター/セッター関数の引数としてプロパティ・キーを提供します。例えば、print(foo.bar)を実行すると、"bar "プロパティのゲッターが呼び出され、その関数は非標準的な追加引数として "bar "を取得します。
var obj = {};
function myGetter(key) {
    // 'this' バインディングはターゲットオブジェクト、'key' は非標準の引数です
}
function mySetter(val, key) {
    // 'this' バインディングはターゲットオブジェクト、'key' は非標準の引数です
}
Object.defineProperties(obj, {
    // こちらも同じゲッター/セッターを使用することができます。
    key1: { enumerable: true, configurable: true, get: myGetter, set: mySetter },
    key2: { enumerable: true, configurable: true, get: myGetter, set: mySetter },
    key3: { enumerable: true, configurable: true, get: myGetter, set: mySetter }
    // ...
});

しかし、ゲッターやセッターは、プロパティアクセスを行わずに呼び出すこともできます。このような場合は、もちろん引数がなくなります。
var desc = Object.getOwnPropertyDescriptor(obj, 'key1');
var getter = desc.get;
print(getter());  // ゲッターを直接呼び出すと、キー名は 'undefined' になります。

この手法では，ゲッター/セッター関数を共有することができますが，それでも各アクセサープロパティをあらかじめ定義しておく必要があります．特に、配列要素の仮想化は、非常に小さい固定サイズの配列を除いて、合理的な方法で行うことができません。
test-dev-nonstd-setget-key-argument.js も参照してください。
Duktape/Cのゲッター/セッターを、非標準のキー引数なしで共有する。
非標準のゲッター/セッター・キー引数を使いたくない場合は、以下のようにDuktape/C関数を1組共有して、複数のプロパティ・キーを仮想化することもできます。
まず、各ゲッター/セッターに対して別々のECMAScript関数が作成され、そのような関数はそれぞれ同じ基礎となるDuktape/C関数を使用します。次に、Duktape/C関数は、それが呼び出されたECMAScript関数インスタンス「経由」に格納されたプロパティを使用して、その動作を特殊化します。以下では、ECMAScript関数インスタンスに格納されているキーのプロパティを紹介します。
各プロパティに対して、以下のようにゲッター/セッター関数を作成することになる。
/* key1' ゲッター/セッター用のECMAScript関数オブジェクトを作成する。 */
duk_push_c_function(my_setter, 1 /*nargs*/);
duk_push_string(ctx, "key1");
duk_put_prop_string(ctx, -2, "key");
duk_push_c_function(my_getter, 0 /*nargs*/);
duk_push_string(ctx, "key1");
duk_put_prop_string(ctx, -2, "key");
/* ... ターゲットオブジェクトにアクセッサプロパティを追加する */

/* 同様に'key2'のゲッター/セッターのためのECMAScript関数オブジェクトを作成し、残りのプロパティについても同様に作成する。 */

Duktape/Cのゲッター関数は、次のようになります（セッターも同様）。
static duk_ret_t my_getter(duk_context *ctx) {
    const char *key;

    /* ゲッターの位置引数はありません。 */

    /* 'this' バインディングからターゲットオブジェクトを取得する（例えば "foo.bar" にアクセスした場合は "foo" を取得する）。 */
    duk_push_this(ctx);

    /* my_getter ネイティブ関数を「ラップ」した ECMAScript 関数からアクセスされている「キー」を取得します。 */
    duk_push_current_function(ctx);
    duk_get_prop_string(ctx, -1, "key");
    key = duk_require_string(ctx, -1);

    /* -> [ この関数のキー ] */

    if (strcmp(key, "key1") == 0) {
        /* key1'に対する動作 */
    } else if (strcmp(key, "key2") == 0) {
        /* key2'に対する動作 */
    }
    /* ... */
}

仮想化された各プロパティに対して、個別のECMAScript関数オブジェクトとターゲットオブジェクト上の事前定義されたアクセッサプロパティが依然として必要である。
ECMAScript E6 プロキシサブセット
プロキシの概要
Duktapeは、アクセッサに加えて、ECMAScript E6のProxy概念のサブセット実装を提供します（参照）。

Proxyオブジェクト（サブセット）：DuktapeのProxy実装における現在の制限事項。
プロキシ・オブジェクト（E6）。ES2015 の Proxy オブジェクトの仕様です。
Proxy (Mozilla):MozillaによるFirefoxに実装されたProxyの説明で、多くの例を含んでいます。

Proxy オブジェクトはゲッター/セッターよりもはるかに強力ですが、ECMAScript エンジンでまだ広く使われている機能ではありません。
has、get、set、deleteProperty トラップの例。
任意のプロパティにアクセスするたびに一行表示する。
// 下地となるプレーンなオブジェクト。
var target = { foo: 'bar' };

// ハンドラテーブル、インタラクションのためのトラップを提供する（オンザフライで変更可能）。
var handler = {
    has: function (targ, key) {
        print('has called for key=' + key);
        return key in targ;  // 存在状態をそのまま返す
    },

    get: function (targ, key, recv) {
        print('get called for key=' + key);
        return targ[key];  // 修正されていない値を返す
    },

    set: function (targ, key, val, recv) {
        print('set called for key=' + key + ', val=' + val);
        targ[key] = val;  // 'set' が定義されている場合、ターゲットへの書き込みを手動で行う必要があります。
        return true;      // true: プロパティ書き込みが許可されたことを示す
    },

    deleteProperty: function (targ, key) {
        print('deleteProperty called for key=' + key);
        delete targ[key];  // 'deleteProperty'が定義されている場合は、手動で削除する必要があります。
        return true;       // true: プロパティの削除が許可されたことを示す
    }
};

// プロキシオブジェクトを作成する。
var proxy = new Proxy(target, handler);

// その後、プロキシオブジェクトは正常にアクセスされる。
print('foo' in proxy);
proxy.foo = 321;
print(proxy.foo);
delete proxy.foo;

Proxyオブジェクトは、基礎となるオブジェクトの読み取り専用バージョンを作成するために使用することもできます（そうしないと、かなり面倒なことになります）。
var proxy = new Proxy(target, {
    // hasとgetは省略：存在チェックと読み出しは自動的にターゲットオブジェクトに通じる

    // setがfalseを返す：書き込みを拒否する
    set: function () { return false; },

    // deleteProperty が false を返す場合：削除を拒否する。
    deleteProperty: function () { return false; }
});

また、オブジェクトの書き込み専用バージョンを作成することもできます（他の方法では不可能です）。
var proxy = new Proxy(target, {
    has: function() { throw new TypeError('has not allowed'); },
    get: function() { throw new TypeError('get not allowed'); }

    // set, deleteProperty を省略した場合： set/delete 操作は許可され、自動的にターゲットにスルーされます。
});

以下は、やや人為的な動作を複数組み合わせた、より複雑な例である。
var target = { foo: 'bar' };

/*
 *  - 'color' はゲッター/セッターの例と同じように動作し、削除できない (削除しようとすると TypeError が発生する)。
 *
 *  - 文字列の値はすべて大文字で読み込まれます。
 *
 *  - アンダースコアで始まるプロパティ名は、いくつかの異なる方法で読み取り/書き込み/削除が保護され、その存在は否定されます。
 */

var handler = {
    has: function (targ, key) {
        // このバインディング：ハンドラテーブル
        // targ: underlying plain object (= target, above)

        if (typeof key === 'string' && key[0] === '_') {
            // pretend that property doesn't exist
            return false;
        }

        return key in targ;
    },

    get: function (targ, key, recv) {
        // このバインディング：ハンドラテーブル
        // targ: underlying plain object (= target, above)
        // key: key (can be any value, not just a string)
        // recv: object being read from (= the proxy object)

        if (typeof key === 'string' && key[0] === '_') {
            throw new TypeError('attempt to access a read-protected property');
        }

        // 戻り値：プロパティ検索結果として提供される値。
        var val = targ[key];
        return (typeof val === 'string' ? val.toUpperCase() : val);
    },

    set: function (targ, key, val, recv) {
        // this binding: ハンドラテーブル
        // targ: underlying plain object (= target, above)
        // key: key (can be any value, not just a string)
        // val: value
        // recv: object being read from (= the proxy object)

        if (typeof key === 'string') {
            if (key === 'color') {
                if (!validateColor(val)) {
                    throw new TypeError('invalid color: ' + val);
                }
                targ.color = val;
                redraw();

                // True: プロパティの書き込みが許可されていることを呼び出し元に示す。
                return true;
            } else if (key[0] === '_') {
                // False: は、プロパティの書き込みが拒否されたことを呼び出し元へ通知する。非厳密モードでは黙って無視されるが、厳密モードではTypeErrorが投げられる。
                return false;
            }
        }

        // ターゲットに書き込む。  また、ターゲットに書き込まずにtrueを返すことで、ターゲットを変更せずに書き込みに成功したことをシミュレートすることもできます。
        targ[key] = val;
        return true;
    },

    deleteProperty: function (targ, key) {
        // this binding: handler table
        // targ: underlying plain object (= target, above)
        // key: key (can be any value, not just a string)

        if (typeof key === 'string') {
            if (key === 'color') {
                // For 'color' a delete attempt causes an explicit error.
                throw new TypeError('attempt to delete the color property');
            } else if (key[0] === '_') {
                // False: は、プロパティの削除が拒否されたことを呼び出し元へ通知する。非厳密モードでは黙って無視されるが、厳密モードではTypeErrorが投げられる。
                return false;
            }
        }

        // ターゲットから削除する。また、ターゲットから削除せずに true を返すことで、ターゲットを変更せずに削除が成功したことをシミュレートすることもできます。
        delete targ[key];
        return true;
    }
};

ES2015のセマンティクスは、トラップが許可する場合でも、いくつかのプロパティアクセスを拒否する。これは、プロキシのターゲットオブジェクトが設定不可能な競合するプロパティを持つ場合に発生します; 詳細はE6セクション9.5.7, 9.5.8, 9.5.9, 9.5.10 を参照してください。ターゲットオブジェクトを空にし、必要なら関係のないプレーンオブジェクトに仮想プロパティをバックアップすることで、このような動作を簡単に回避することができます。
enumerate および ownKeys トラップの例
これらのトラップは以下のように呼び出されます。



Call site
Trap
Notes




Object.keys()
ownKeys



Object.getOwnPropertyNames()
ownKeys



for-in enumeration
ownKeys
In Duktape 2.x, matching ES2016 semantics.


for-in enumeration
enumerate
In Duktape 1.x, matching ES2015 semantics.(*1)



(*1) ただし、配列または「配列のような」トラップ結果のみがサポートされています（ES2015初期のドラフト動作）。標準のES2015 "enumerate" トラップはイテレータを返さなければなりませんが、Duktape 1.xではイテレータはサポートされていません。ES2016のセマンティクスに合わせて "enumerate" トラップを削除し、Duktape 2.x では決して呼び出されません。
以下の例は、Duktape 1.x用です。
アンダースコアで始まるプロパティ名を列挙とObject.keys()およびObject.getOwnPropertyNames()から非表示にする。
var target = {
    foo: 1,
    bar: 2,
    _quux: 3,
    _baz: 4
};

var proxy = new Proxy(target, {
    enumerate: function (targ) {
        // this binding: handler table
        // targ: underlying plain object (= target, above)

        return Object.getOwnPropertyNames(targ)
                     .filter(function (v) { return v[0] !== '_'; });
    },

    ownKeys: function (targ) {
        return Object.getOwnPropertyNames(targ)
                     .filter(function (v) { return v[0] !== '_'; });
    }
});

function test() {
    for (var k in proxy) {
        print(k);  // prints 'foo' and 'bar'
    }
}
test();

print(Object.keys(proxy));                 // prints 'foo,bar'
print(Object.getOwnPropertyNames(proxy));  // prints 'foo,bar'

コンストラクタ関数でProxyを使用する
コンストラクタがオブジェクト値を返す場合、その値は、このバインディング E5.1 セクション 13.2.2 としてコンストラクタで利用できる自動的に作成されたデフォルトのインスタンスを置き換えます。これにより、コンストラクタ呼び出しの結果としてコンストラクタからProxyオブジェクトが返されるようになります。
また、thisオブジェクトを普通に初期化して、それをProxyでラップすることもできます（test-bi-proxy-in-constructor.jsを参照）。
function MyConstructor() {
    // 普通に'this'を初期化する
    this.foo = 'bar';

    // プロキシで囲む
    return new Proxy(this, {
        // プロキシトラップ
    });
}

var obj = new MyConstructor();

Duktapeが対応していないメカニズム
プロパティの仮想化には、さまざまな非標準のメカニズムがあります。これらはDuktapeではサポートされていません。

Object.prototype.watch()

how_to_use_finalization.html.body:
ファイナライズの使用方法
ドキュメンテーションガイド: http://duktape.org/guide.html#finalization.
簡単な例
ファイナライズ例:
// finalize.js
var a;

function init() {
    a = { foo: 123 };

    Duktape.fin(a, function (x) {
        try {
            print('finalizer, foo ->', x.foo);
        } catch (e) {
            print('WARNING: finalizer failed (ignoring): ' + e);
        }
    });
}

// オブジェクトを作成し、'a'を通してそれを参照する。
init();

// 参照削除，参照カウントで即座に確定
print('refcount finalizer');
a = null;

// refcountingが無効の場合、マーク＆スイープのファイナライズはここで発生します（遅くとも）。
print('mark-and-sweep finalizer')
Duktape.gc();

上の例のファイナライザーの内部で try-catch ラッパーを使用することを強く推奨します。捕捉されないファイナライザーエラーは黙って無視されるので、ファイナライザーが全く実行されないように見えるかもしれません。
これをDuktapeコマンドラインツール（デフォルトのDuktapeプロファイルを使用）で実行すると、次のようになります。
$ duk finalize.js
refcount finalizer
finalizer, foo -> 123
mark-and-sweep finalizer
Cleaning up...

プロトタイプオブジェクトへのファイナライザーの追加
同じ型のオブジェクトが多数ある場合、プロトタイプにファイナライザーを追加することで、オブジェクトインスタンスのプロパティカウントを最小にすることができます。
// プラットフォーム固有のファイル記述子に関連付けられた仮想的なSocketオブジェクトの例です。

function Socket(host, port) {
    this.host = host;
    this.port = port;
    this.fd = Platform.openSocket(host, port);
}
Duktape.fin(Socket.prototype, function (x) {
    if (x === Socket.prototype) {
        return;  // called for the prototype itself
    }
    if (typeof x.fd !== 'number') {
        return;  // already freed
    }
    try {
        Platform.closeSocket(x.fd);
    } catch (e) {
        print('WARNING: finalizer failed for fd ' + x.fd + ' (ignoring): ' + e);
    }
    delete x.fd;
});

// Socketインスタンスに対して明示的なファイナライザーを登録することなく、任意のSocketインスタンスがファイナライズされるようになりました。

var sock = new Socket('localhost', 8080);

ヒープ破壊
Duktapeのヒープが破壊されるとき、ファイナライザーは通常通り呼び出されます。

オブジェクトを救出することはできません。ファイナライザーは、最初のファイナライザー呼び出しでネイティブ・リソースを解放しなければなりません。なぜなら、ターゲット・オブジェクトへの新しい参照が作成されても、ファイナライザーは再び呼び出されないからです。
ファイナライザーは、新しいファイナライズ可能なオブジェクトを作成することができ、これらもファイナライズされます。しかし、この処理には、暴走するファイナライザーを捕まえるための健全性の限界があります。通常、この制限に遭遇することはないはずです。

Duktape 1.4.0以降、ファイナライザーには第2引数が与えられています。これは、オブジェクトが救出できない（ヒープ破壊が進行している）かどうかを示すブール値です。この引数は、救出が不可能な場合は真、そうでない場合は偽となります。Duktape 1.3.0以前では、この引数は提供されません。
もしファイナライザーが、(1)解放しなければならないネイティブ・リソースを管理し、 (2)オブジェクトの救助を使い、後でファイナライザーが再び呼ばれることに依存しているなら、 例えば、ヒープ破壊の場合を明示的にチェックする必要があります。
function myFinalizer(obj, heapDestruct) {
    if (heapDestruct) {
        // ヒープが破壊されているので、すぐに解放する必要があります。
        freeNativeResources();
        return;
    }

    // 通常の場合：後でファイナライザが呼ばれることを保証して、オブジェクトを救出することができる。
}

ヒープ破壊時のファイナライザーの現在のサニティ・アルゴリズム
ヒープ破棄時のファイナライザーのサニティ制限は、現在おおよそ以下のように動作します（正確な詳細はリリース間で変更される可能性があります）。

割り当てられたすべてのヒープ・オブジェクトが反復処理され、ファイナライザが実行可能なオブジェクトはすべてファイナライズされます。ファイナライザーは特定のオブジェクトに対して二度と実行されません。これは DUK_HEAPHDR_FLAG_FINALIZED を使って追跡されます。n_total を全ヒープオブジェクトの数、n_finalized をこのラウンドでファイナライザを実行した（というか実行しようとした）全オブジェクトの数とします。
ファイナライズ可能なオブジェクトの数の限界は次のように計算される。
最初のラウンド: n_limit = 2 * n_total.
次のラウンドでは、n_limit = n_limit * 3 / 4、つまり約25%減少します。
n_finalized == 0 の場合、すべてのファイナライザーが終了し、終了します。
n_finalized >= n_limit の場合、ファイナライズ可能なオブジェクトの数が予想通り減らないので、おそらくファイナライザが暴走していることが原因です。ファイナライズ処理は終了し、残りのファイナライザーは実行されません。
その他の場合は、ループを再開してください。

このアルゴリズムの動機は、明らかに暴走したファイナライザーがあり、プロセスが終了できない場合を除き、ヒープ破壊ですべてのファイナライザーが実行されるようにすることです。
最終化可能なオブジェクトの数を増やすために、最初の制限値はかなり大きくなっていますが、その後ラウンドごとに少なくとも25%減少しなければ最終化処理は中止されます。
ヒープ破壊のアプローチについては、https://github.com/svaarala/duktape/pull/473 でいくつか議論されています。

how_to_work_with_buffers_in_duktape_2x.h.body:
Duktape 2.xでバッファを操作する方法
このページは、Duktape 2.xにのみ適用されます。
はじめに
バッファタイプの概要



Buffer type
Standard
C API type
ECMAScript type
Description




Plain buffer
NoDuktape specific
DUK_TAG_BUFFER
[object Uint8Array]
メモリ効率の良いバッファ値(オブジェクトではない)。ECMAScript のほとんどの動作は Uint8Array を模倣しており、C API では別の型となっています。オブジェクトは実際の Uint8Array のインスタンスに強制されます。仮想インデックスプロパティを持つ。(Duktape2.xで動作が変更されました。)


ArrayBuffer object
YesES2015
DUK_TAG_OBJECT
[object ArrayBuffer]
バイト配列を表現するための標準的なオブジェクト型。非標準の仮想インデックスプロパティを追加で持つ。


DataView, typed array objects
YesES2015
DUK_TAG_OBJECT
[object Uint8Array], etc
標準的なビューオブジェクトで、基礎となる ArrayBuffer にアクセスする。


Node.js Buffer object
NoNode.js-like
DUK_TAG_OBJECT
[object Uint8Array]
Node.jsのBuffer APIを使ったオブジェクトです。現在、Node.jsのバージョンは6.7.0ですが、Duktapeは少し遅れて最新のものをトラッキングしています。



ArrayBufferおよび型付き配列の推奨値
新しいコードでは、特別な理由がない限り、ES2015のArrayBufferと型付き配列（Uint8Arrayなど）を使用することをお勧めします。型付き配列を使い始めるためのチュートリアルはこちらです。

http://www.html5rocks.com/en/tutorials/webgl/typed_arrays/

ArrayBufferはバイトバッファをカプセル化します。例えば、Uint32Arrayは32ビットの連続した配列に対応する仮想配列を提供します。型付き配列はホスト固有のエンディアンを持ち、基礎となるバッファに対してアライメントが必要です。DataViewはArrayBufferの中の任意にアラインされた要素（整数や浮動小数点）を読み書きするためのアクセサリ群を提供します。エンディアンは明示的に指定できるので、DataViewは例えばファイルフォーマット操作に便利です。
低メモリ環境向けのプレーンバッファ
非常に少ないメモリ環境では、通常 Uint8Array が使用される場所でプレーンバッファーを使用することができます。プレーンバッファは ECMAScript コードに対して Uint8Array の動作をかなり忠実に模倣しており、実際の Uint8Array とプレーンバッファの間を移動する際に、しばしば小さな ECMAScript コード変更のみが必要となります。しかし、C のコードでは型付けの違いに注意する必要があります。
プレーン バッファは、バッファへの uint8 アクセスを提供するだけです。プレーン・バッファには、固定バッファ、動的バッファ（サイズ変更可能）、外部バッファ（Duktapeの制御外のユーザ制御バッファを指す）の3種類があります。プレーン バッファの値オブジェクトは Uint8Array オブジェクトに変換されます。これは、プレーン文字列オブジェクトが String オブジェクトに変換されるのと同様です。
Duktapeの設定でバッファ・オブジェクトのサポートが無効になっている場合、プレーン・バッファのみが使用可能になります。これらは Uint8Array.prototype を継承し、プレーンバッファーの値 (例: buf.__proto__) から到達可能ですが、グローバルオブジェクトには登録されません。すべての型付き配列メソッドは存在しません。この意図は、Cコードからバッファを操作することにあります。
Node.js バッファバインディング
Node.jsのBufferバインディングは、Node.js互換のコードを扱うときに便利です。
Node.jsのBufferは、uint8の仮想配列とDataViewのようなエレメントアクセッサのセットを、すべて1つのオブジェクトで提供します。Node.js は ES2015 のように安定した仕様ではないので、Node.js Buffer は型付き配列よりも動きのあるターゲットです。
バッファタイプのミキシングをサポートするが、推奨しない
すべてのバッファオブジェクトの内部データ型は同じなので、ある程度は混ぜることができます。例えば、Node.js の Buffer.concat() は任意のバッファタイプを連結して使用することができます。しかし、混在の動作は時間の経過とともに変化しやすいので、混在させることに明確な利点がない限り、混在させない方が良いでしょう。
今後の変更点
今後のリリースの開発の方向性としては、以下のようなものが考えられます。

バッファのセマンティクスをES2015+に近づける。
標準的な型は、よりメモリ効率と性能の高いものにする。
C API のプレーンバッファと型付き配列オブジェクトの区別をなくす。

参考文献

buffer" タグのついた API コールで、プレーンなバッファを扱います。
bufferobject "タグの付いたAPIコールでバッファオブジェクトを扱えます。
ES2015 型付き配列仕様 (ArrayBufferコンストラクタ、型付き配列コンストラクタ、ArrayBufferオブジェクト、DataViewオブジェクト)
Node.js バッファAPI
buffers.rstに内部を記述しています。
